package com.example.entity;import com.example.entity.Base.StringBaseEntity;import com.example.enums.Like;import jakarta.persistence.*;import lombok.Getter;import lombok.Setter;@Setter@Getter@Entity@Table(name = "video_like_history")public class VideoLikeHistoryEntity extends StringBaseEntity {    @Column(name = "video_id")    private String videoId;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "video_id", updatable = false, insertable = false)    private VideoEntity videoEntity;    @Column(name = "profile_id")    private Integer profileId;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "profile_id", updatable = false, insertable = false)    private ProfileEntity profileEntity;    @Column(name = "is_liked")    @Enumerated(EnumType.STRING)    private Like like;}